          "version:1.5\ncell:A1:l:1\ncell:B3:t:INTRODUCTION:f:2:c:3:bg:1:cf:1\ncell:B4:f:2\ncell:B5:f:2\ncell:B6:t:The Nutrition Tracker app enables you to keep a track of your food and nutrition intake on a daily, weekly and monthly basis. Week trackers for four weeks, have been provided, along with an item log sheet. The results have been summarized visually with graphs for easy analysis.:f:2\ncell:B7:t:The weekly tracker sheets allow items to be organised on a weekly basis, following a four meals per day schedule. The log sheet contains a master record of the foods, along with their nutrition values. Provision has been made to track up to four nutrients at the same time. The app allows you to record up to fifty different food items.:f:2:bg:2\ncell:B8:f:2\ncell:B9:t:1.  Enter the items in the log sheet, along with their nutrition values. :f:2\ncell:B10:f:2\ncell:B11:t:2.  Add the tag along with the name. The tag serves as a reference to the food items. It has to be different for every item. You can also add additional notes.:f:2:bg:2\ncell:B12:f:2\ncell:B13:t:3. In the diet journals, enter the starting date along with the time for each meal. Then put the relevant tag for the food you ate.:f:2\ncell:B14:f:2\ncell:B15:t:4. The nutritional information is automatically generated. The results are also summarized by graphs. They help you to track the individual nutrition values for the different weeks for, let you compare the nutrient intake on a week basis, and find the relative total nutrients in your diet.:f:2:bg:2\ncell:B16:f:2\ncell:B17:t:5. Just write \"yes\" for the week that you wish to view, or write the week's number (numeric 1, 2, 3 or 4), to view the corresponding week's graph.:f:2\ncell:B18:f:2\ncell:B19:t:Entering data is simple. Tap on the cell to edit and add the text. Locally save your Nutrition Tracker as a file, and re-use it with minimal changes. Simply tap e-mail to send it to your family, friends, or nutritionist instantly and get feedback from them. Alternatively, you can email it to yourself. Note\\c The tag value is just for reference purposes. It can be the name of the food itself, or just a number or any other word, depending on your choice.:f:2\ncell:B20:t:If you need any further assistance in using the Nutrition Tracker application, or would like to see some new features in the future versions of the application, please write to us at marketing@tickervalue.com You can also meet us on Skype by sending a contact request to aspiring.investments.:f:2:bg:2\ncell:B21:f:2\ncol:A:w:10\ncol:B:w:305\nsheet:c:2:r:21:font:1:layout:2\ncellformat:1:center\ncolor:1:rgb(119,136,221)\ncolor:2:rgb(230,230,250)\ncolor:3:rgb(255, 255, 255)\nfont:1:* 11pt arial,helvetica,sans-serif\nfont:2:* small *\nlayout:1:padding:4px * * *;vertical-align:*;\nlayout:2:padding:4px 4px 4px 4px;vertical-align:*;\n",
